import { useState, SyntheticEvent } from "react";

import {  TextField, Grid, Button, InputLabel, Select, MenuItem  } from '@mui/material';

import { Discharge, EntryFormValues, EntryType, HealthCheckRating, SickLeave } from "../../../types";

interface Props {
  onCancel: () => void;
  onSubmit: (values: EntryFormValues) => void;
  type: EntryType
}

const AddEntryForm = ({ onCancel, onSubmit, type }: Props) => {
  const [description, setDescription] = useState('');
  const [date, setDate] = useState('');
  const [specialist, setSpecialist] = useState('');
  const [diagnosisCodes, setCodes] = useState<string[]>([]);
  const [healthCheckRating, setHealthCheckRating] = useState<HealthCheckRating>(0);
  const [discharge, setDischarge] = useState<Discharge>( { date: "", criteria: "" } );
  const [sickLeave, setSickLeave] = useState<SickLeave>();
  const [employerName, setEmployerName] = useState('');

  const addEntry = (event: SyntheticEvent) => {
    event.preventDefault();

    switch (type) {
      case EntryType.Hospital:
        return onSubmit({
          description,
          date,
          specialist,
          diagnosisCodes,
          discharge,
          type: "Hospital"
        });
      case EntryType.HealthCheck:
        return onSubmit({
          description,
          date,
          specialist,
          diagnosisCodes,
          healthCheckRating,
          type: "HealthCheck"
        });
      case EntryType.OccupationalHealthcare:
        return onSubmit({
          description,
          date,
          specialist,
          diagnosisCodes,
          employerName,
          sickLeave,
          type: "OccupationalHealthcare"
        });
      default:
        return;
    }
  };

  const createCodesArray = (value: string | undefined) => {
    if (value) {
      const codeArray = value.split(" ");
      return setCodes(codeArray);
    }

    return setCodes([]);
  };

  switch (type) {
    case EntryType.Hospital:
      return (
        <div>
          <form onSubmit={addEntry}>
            <TextField
              label="Date"
              fullWidth 
              value={date}
              onChange={({ target }) => setDate(target.value)}
            />
            <TextField
              label="Description"
              fullWidth
              value={description}
              onChange={({ target }) => setDescription(target.value)}
            />
            <TextField
              label="Specialist"
              fullWidth
              value={specialist}
              onChange={({ target }) => setSpecialist(target.value)}
            />
            <TextField
              label="Discharge Date"
              fullWidth
              value={discharge.date}
              onChange={({ target }) => setDischarge( { date: target.value, criteria: discharge.criteria } )}
            />
            <TextField
              label="Discharge Criteria"
              fullWidth
              value={discharge.criteria}
              onChange={({ target }) => setDischarge( { date: discharge.date, criteria: target.value } )}
            />
            <TextField
              label="Diagnosis Codes"
              fullWidth
              value={diagnosisCodes}
              onChange={({ target }) => createCodesArray(target.value)}
            />
    
            <Grid>
              <Grid item>
                <Button
                  color="secondary"
                  variant="contained"
                  style={{ float: "left" }}
                  type="button"
                  onClick={onCancel}
                >
                  Cancel
                </Button>
              </Grid>
              <Grid item>
                <Button
                  style={{
                    float: "right",
                  }}
                  type="submit"
                  variant="contained"
                >
                  Add
                </Button>
              </Grid>
            </Grid>
          </form>
        </div>
      );
    case EntryType.HealthCheck:
      return (
        <div>
          <form onSubmit={addEntry}>
            <TextField
              label="Date"
              fullWidth 
              value={date}
              onChange={({ target }) => setDate(target.value)}
            />
            <TextField
              label="Description"
              fullWidth
              value={description}
              onChange={({ target }) => setDescription(target.value)}
            />
            <TextField
              label="Specialist"
              fullWidth
              value={specialist}
              onChange={({ target }) => setSpecialist(target.value)}
            />
            <InputLabel style={{ marginTop: 20 }}>Health Check Rating</InputLabel>
            <Select
              label="Gender"
              fullWidth
              value={type}
              onChange={onRatingChange}
            >
            {Object.values(HealthCheckRating).map(option =>
              <MenuItem key={option} value={option}>
                {option}
              </MenuItem>
            )}
            </Select>
            <TextField
              label="Diagnosis Codes"
              fullWidth
              value={diagnosisCodes}
              onChange={({ target }) => createCodesArray(target.value)}
            />
    
            <Grid>
              <Grid item>
                <Button
                  color="secondary"
                  variant="contained"
                  style={{ float: "left" }}
                  type="button"
                  onClick={onCancel}
                >
                  Cancel
                </Button>
              </Grid>
              <Grid item>
                <Button
                  style={{
                    float: "right",
                  }}
                  type="submit"
                  variant="contained"
                >
                  Add
                </Button>
              </Grid>
            </Grid>
          </form>
        </div>
      );
    case EntryType.OccupationalHealthcare:
      return(
        <div>

        </div>
      );
    default:
      return(
        <div>

        </div>
      );
  }
};

export default AddEntryForm;
